// DOM Elements
const settingsPage = document.getElementById("settings-page");
const settingsBtn = document.getElementById("settings-btn");
const saveSettingsBtn = document.getElementById("save-settings-btn");
const calculateBtn = document.getElementById("calculate-btn");
const backButton = document.getElementById("back-button");
const downloadButton = document.querySelector(".download-button");
const pipeToggle = document.getElementById("pipeToggle");
const inputs2inch = document.getElementById("inputs-2inch");
const inputs3inch = document.getElementById("inputs-3inch");

// Toggle between 2-inch and 3-inch inputs
pipeToggle.addEventListener("change", () => {
    if (pipeToggle.value === "2inch") {
        inputs2inch.classList.remove("hidden");
        inputs3inch.classList.add("hidden");
    } else {
        inputs2inch.classList.add("hidden");
        inputs3inch.classList.remove("hidden");
    }

    // Add to pipeToggle event listener
    const settings2Inch = document.getElementById('settings-2inch');
    const settings3Inch = document.getElementById('settings-3inch');

    if (pipeToggle.value === "2inch") {
        settings2Inch.classList.remove("hidden");
        settings3Inch.classList.add("hidden");
    } else {
        settings3Inch.classList.remove("hidden");
        settings2Inch.classList.add("hidden");
    }

});

// Toggle Settings Page
settingsBtn.addEventListener("click", () => {
    settingsPage.classList.toggle("hidden");
});

// Save Settings
saveSettingsBtn.addEventListener("click", (event) => {
    event.preventDefault();
    // 2-inch rates
    pipeRate = parseFloat(document.getElementById("pipeRate").value);
    elbowRate = parseFloat(document.getElementById("elbowRate").value);
    transectionRate = parseFloat(document.getElementById("transectionRate").value);
    equalTeeRate = parseFloat(document.getElementById("equalTeeRate").value);
    couplerRate = parseFloat(document.getElementById("couplerRate").value);
    stubsRate = parseFloat(document.getElementById("stubsRate").value);
    flangeRate = parseFloat(document.getElementById("flangeRate").value);
    nutboltRate = parseFloat(document.getElementById("nutboltRate").value);

    // 3-inch rates
    pipeRate3 = parseFloat(document.getElementById("pipeRate3").value);
    transectionRate3 = parseFloat(document.getElementById("transectionRate3").value);
    couplerRate3 = parseFloat(document.getElementById("couplerRate3").value);
    stubFlangeRate3 = parseFloat(document.getElementById("stubFlangeRate3").value);
    elbowRate3 = parseFloat(document.getElementById("elbowRate3").value);
    nutboltRate3 = parseFloat(document.getElementById("nutboltRate3").value);

    settingsPage.classList.add("hidden");

});

// Calculate Results
calculateBtn.addEventListener("click", (event) => {
    event.preventDefault();
    const is2Inch = pipeToggle.value === "2inch";
    let pipeQuantity=1, elbowQuantity=0, transectionQuantity=0 , equalTeeQuantity=0, couplerQuantity=0, stubsQuantity=0, flangeQuantity=0, nutboltQuantity=0, rate=0, partyName="", address="", quotationNum=0, GSTNum="";
    
    let pipeQuantity3=1,transectionQuantity3=0,couplerQuantity3=0,stubFlangeQuantity3=0,elbowQuantity3=0,nutboltQuantity3=0,rate3=0,partyName3="",address3="",quotationNum3=0,GSTNum3="";


    if (is2Inch) {
        pipeQuantity = parseInt(document.getElementById("pipeQuantity").value) || 0;
        elbowQuantity = parseInt(document.getElementById("elbowQuantity").value) || 0;
        transectionQuantity = parseInt(document.getElementById("transectionQuantity").value) || 0;
        equalTeeQuantity = parseInt(document.getElementById("equalTeeQuantity").value) || 0;
        couplerQuantity = parseInt(document.getElementById("couplerQuantity").value) || 0;
        stubsQuantity = parseInt(document.getElementById("stubsQuantity").value) || 0;
        flangeQuantity = parseInt(document.getElementById("flangeQuantity").value) || 0;
        nutboltQuantity = parseInt(document.getElementById("nutboltQuantity").value) || 0;
        rate = parseFloat(document.getElementById("rate").value) || 0;
        partyName = document.getElementById("partyName").value || "N/A";
        address = document.getElementById("address").value || "N/A";
        quotationNum = parseInt(document.getElementById("quotationNum").value) || 0;
        GSTNum = document.getElementById("GSTNum").value || "N/A";
        transportationCost = parseFloat(document.getElementById("transportationCost").value) || 0;
        labourCost = parseFloat(document.getElementById("labourCost").value) || 0;
    } else {
        pipeQuantity3 = parseInt(document.getElementById("pipeQuantity3").value) || 0;
        transectionQuantity3 = parseInt(document.getElementById("transectionQuantity3").value) || 0;
        couplerQuantity3 = parseInt(document.getElementById("couplerQuantity3").value) || 0;
        stubFlangeQuantity3 = parseInt(document.getElementById("stubFlangeQuantity3").value) || 0;
        elbowQuantity3 = parseInt(document.getElementById("elbowQuantity3").value) || 0;
        nutboltQuantity3 = parseInt(document.getElementById("nutboltQuantity3").value) || 0;
        rate3 = parseFloat(document.getElementById("rate3").value) || 0;
        partyName3 = document.getElementById("partyName3").value || "N/A";
        address3 = document.getElementById("address3").value || "N/A";
        quotationNum3 = parseInt(document.getElementById("quotationNum3").value) || 0;
        GSTNum3 = document.getElementById("GSTNum3").value || "N/A";
        transportationCost = parseFloat(document.getElementById("transportationCost").value) || 0;
        labourCost = parseFloat(document.getElementById("labourCost").value) || 0;
    }

    const sellingPrice = is2Inch? pipeQuantity * rate : pipeQuantity3 * rate3;

    const totalCost = is2Inch
        ? pipeQuantity * pipeRate +
          elbowQuantity * elbowRate +
          transectionQuantity * transectionRate +
          equalTeeQuantity * equalTeeRate +
          couplerQuantity * couplerRate +
            stubsQuantity * stubsRate +
            flangeQuantity * flangeRate +
            nutboltQuantity * nutboltRate +
          transportationCost +
          labourCost
        : pipeQuantity3 * pipeRate3 +
            transectionQuantity3 * transectionRate3 +
            couplerQuantity3 * couplerRate3 +
            stubFlangeQuantity3 * stubFlangeRate3 +
            elbowQuantity3 * elbowRate3 +
            nutboltQuantity3 * nutboltRate3 +
            transportationCost +
            labourCost;

    const totalProfit = sellingPrice - totalCost;
    const profitRate = is2Inch? ((totalCost * (1 + (30 / 100))) / pipeQuantity) : ((totalCost * (1 + (30 / 100))) / pipeQuantity3);

    // Update Results
    document.getElementById("sellingPrice").innerText = sellingPrice.toFixed(2);
    document.getElementById("totalCost").innerText = totalCost.toFixed(2);
    const profitPercentage = ((sellingPrice - totalCost) / totalCost) * 100;
    document.getElementById("totalProfit").innerText = `${totalProfit.toFixed(2)} (${profitPercentage.toFixed(2)}%)`;
    document.getElementById("profitRate").innerText = profitRate.toFixed(2);

    console.log(
        "Calculation Done. Ready for download : " + "Pipe is " + is2Inch
    )


    // // Generate PDF
    // downloadButton.addEventListener("click", () => {
    //     if(is2Inch){
    //         console.log("Sending generate PDF 2 inch")
    //         generatePDF(
    //             is2Inch,
    //             pipeQuantity,
    //             rate,
    //             partyName,
    //             address,
    //             quotationNum,
    //             GSTNum,
    //             sellingPrice,
    //         );
    //     }
    //     else{
    //         console.log("Sending generate PDF 3 inch")
    //         generatePDF(
    //             is2Inch,
    //             pipeQuantity3,
    //             rate3,
    //             partyName3,
    //             address3,
    //             quotationNum3,
    //             GSTNum3,
    //             sellingPrice
    //         );
    //     }
    //     // generatePDF(
    //     //     is2Inch,
    //     //     pipeQuantity,
    //     //     rate,
    //     //     partyName,
    //     //     address,
    //     //     quotationNum,
    //     //     GSTNum,
    //     //     sellingPrice,
    //     // );
    // });
    function debounce(func, wait) {
        let timeout;
        return function(...args) {
          clearTimeout(timeout);
          timeout = setTimeout(() => func.apply(this, args), wait);
        };
      }
      
    downloadButton.addEventListener("click", debounce(() => {
        if(is2Inch){
            console.log("Sending generate PDF 2 inch")
            generatePDF(
                is2Inch,
                pipeQuantity,
                rate,
                partyName,
                address,
                quotationNum,
                GSTNum,
                sellingPrice,
            );
        }
        else{
            console.log("Sending generate PDF 3 inch")
            generatePDF(
                is2Inch,
                pipeQuantity3,
                rate3,
                partyName3,
                address3,
                quotationNum3,
                GSTNum3,
                sellingPrice
            );
        }
    }, 300));
});





backButton.addEventListener("click", () => {
    settingsPage.classList.add("hidden");
});

