    let month = new Date().getMonth() + 1;
    if(month<=3) year-=1;

    console.log("INTO THE FUNCTION with " + is2Inch);

    // Function to add image (replace with actual image data if needed)
    function addFoxtailLogo(doc, x, y, width, height) {
        const logoBase64 = 'data:image/png;base64,';
        doc.addImage(logoBase64, 'PNG', x, y, width, height);
    }

    function addTable(doc,x,y,width,height){
        const logoBase64 = 'data:image/png;base64,';
        doc.addImage(logoBase64, 'PNG', x, y, width, height);
    }

    // Colors and Fonts
    const textColor = "#000000"; // Black
    const headingColor = "#000080"; // Dark Blue
    doc.setTextColor(textColor);
    doc.setFont("helvetica", "normal");

    // doc.text(is2Inch, 10, 10);
