    // doc.text(pipeQuantity.toFixed(0), 10, 70);
    // doc.text(sellingPrice.toFixed(0), 10, 80);

    // Page Header
    addFoxtailLogo(doc, 5, 5, 200, 70);
    

    // Quotation Details
    doc.setFont("helvetica", "bold");
    doc.setFontSize(10);
    doc.text(`Ref: F.V/${year%100}-${(year+1)%100}/HDPE/Q/${quotationNum}`, 15, 75);
    const currentDate = new Date().toLocaleDateString('en-GB').replace(/\//g, '.');
    doc.text(`Date: ${currentDate}`, 165, 75);

    // Customer Details
    doc.setFontSize(9);
    doc.text("To", 15, 85);
    doc.text(`CUSTOMER NAME: ${partyName}`, 15, 90);
    doc.text(`SHIPPING ADDRESS: ${address}`, 15, 95);
    doc.text(`GSTNO.: ${GSTNum}`, 15, 100);

    // Quotation Summary
    if(is2Inch)
    {
        doc.text("SUB.: QUOTATION FOR HDPE PIPE 63MM WITH FITTING", 15, 110);
    }
    else
    {
        doc.text("SUB.: QUOTATION FOR HDPE PIPE 80MM WITH FITTING", 15, 110);
    }

    // Greeting
    doc.setFontSize(9);
    doc.setFont("helvetica", "normal");
    doc.text("Dear Sir,", 15, 120);
    doc.text("We are very much pleased to submit our best rates:", 15, 125);

    // Table Headers and Content
    // doc.setFillColor("#2fce42"); // LightGreen
