    // doc.setFont("helvetica", "bold");
    // doc.setFontSize(9);
    // doc.text("SL NO", 20, 142);
    // doc.text("DESCRIPTION", 45, 142);
    // // doc.text("UNIT", 95, 107);
    // doc.text("RATE", 120, 142);
    // doc.text("QUANTITY", 145, 142);
    // doc.text("AMOUNT", 175, 142);
    addTable(doc,15,136,180,40);



    // Table Content
    doc.setFont("courier", "bold");
    doc.setFontSize(11);
    if(is2Inch)
    {
        doc.text("63", 56, 148);
    }
    else
    {
        doc.text("80", 56, 148);
    }
    doc.setFontSize(10);
    let ratelen = rate.toFixed(2).length;
    let ratex = 123 - (ratelen-4);
    doc.text(`${rate.toFixed(2)}`, ratex, 148); // Price


